import React from "react";
import Form from 'react-bootstrap/Form';
import FormControl from "./FormControl";
import Row from "react-bootstrap/esm/Row";
import Col from "react-bootstrap/esm/Col";

class UserForm extends React.Component{
    constructor(props) {
        super(props);
    }

    render(){
        return(
            <Form>
                <Row>
                <Col><FormControl controlId="formFirstName" label="First Name" placeholder="Enter First Name"></FormControl></Col>
                <Col><FormControl controlId="formLastName" label="Last Name" placeholder="Enter Last Name"></FormControl></Col>
                </Row>
            </Form>
        )
    } 
}

export default UserForm;
